css:
:root {
  font-size: 16px;
}
.conflict-resolved {
  background: rgba(0, 150, 136, 0.1);
}
.conflict-ours {
  background: rgba(200, 227, 170, 0.5);
}
.conflict-ours.cursor-line {
  background: rgba(176, 214, 131, 0.5);
}
.conflict-theirs {
  background: rgba(154, 207, 250, 0.5);
}
.conflict-theirs.cursor-line {
  background: rgba(106, 184, 247, 0.5);
}
.conflict-dirty {
  background: #6e6300;
}
.conflict-dirty.cursor-line {
  background: #a19100;
}
